import React, { useState, useEffect } from "react";
import axios from "axios";

function DataFetch() 
{
  return axios.get("https://dummyjson.com/todos")
            .then(res => {
                return(res.data.todos)
            })
            .catch(error => {
                alert(error);
                return []
            })
}

export default DataFetch
